import React from "react";

const EducationContent = ({ edInfo }) => {
  return (
    <div>
      <div>
        {edInfo.grade}  ( {edInfo.date} )
      </div>
      <div>
        <h2>{edInfo.school}</h2>
      </div>
      <div>
        <p>{edInfo.place}</p>
      </div>
      <div>
        <p>{edInfo.marks}</p>
      </div>
    </div>
  );
};

export default EducationContent;
